const canvas = document.getElementById("game");
const ctx = canvas.getContext("2d");
canvas.width = 608;
canvas.height = 608;
const box = 32;
// let start = window.alert("Click any arrow key to start your game!\nBest Of Luck!");
const ground = new Image();
ground.src = "data:image/png;base64,"
const foodImg = new Image();
foodImg.src =
  "data:image/png;base64,";

let dead = new Audio();
let down = new Audio();
let eat = new Audio();
let left = new Audio();
let right = new Audio();
let up = new Audio();

dead.src = "sounds/audio_dead.mp3";
down.src = "sounds/audio_down.mp3";
eat.src = "sounds/audio_eat.mp3";
left.src = "sounds/audio_left.mp3";
right.src = "sounds/audio_right.mp3";
up.src = "sounds/audio_up.mp3";

let snake = [];

snake[0] = {
  x: 9 * box,
  y: 10 * box,
};

let food = {
  x: Math.floor(Math.random() * 17 + 1) * box,
  y: Math.floor(Math.random() * 15 + 3) * box,
};

let score = 0;

let d;

document.addEventListener("keydown", direction);

function direction(event) {
  let key = event.key;
  console.log(key);
  if (key === "ArrowLeft" && d != "RIGHT") {
    left.play();
    d = "LEFT";
  } else if (key === "ArrowUp" && d != "DOWN") {
    d = "UP";
    up.play();
  } else if (key === "ArrowRight" && d != "LEFT") {
    d = "RIGHT";
    right.play();
  } else if (key === "ArrowDown" && d != "UP") {
    d = "DOWN";
    down.play();
  }
}

function collide(head, array) {
  for (let i = 0; i < array.length; i++) {
    if (head.x == array[i].x && head.y == array[i].y) {
      return true;
    }
  }
  return false;
}

function draw() {
  ctx.drawImage(ground, 0, 0);
  for (let i = 0; i < snake.length; i++) {
    ctx.fillStyle = i == 0 ? "green" : "palegreen";
    ctx.fillRect(snake[i].x, snake[i].y, box, box);

    ctx.strokeStyle = "red";
    ctx.strokeRect(snake[i].x, snake[i].y, box, box);
  }
  ctx.drawImage(foodImg, food.x, food.y);

  let snakeX = snake[0].x;
  let snakeY = snake[0].y;

  if (d == "LEFT")
    snakeX -= box;
  if (d == "RIGHT") snakeX += box;
  if (d == "UP") snakeY -= box;
  if(d=="DOWN") snakeY += box;

  if(snakeY==food.y && snakeX==food.x){
      score++;
      eat.play();
      food = {
        x: Math.floor(Math.random() * 17 + 1) * box,
        y: Math.floor(Math.random() * 15 + 3) * box,
      };
  } else {
      snake.pop();
  }

  let newHead = {
      x:snakeX,
      y:snakeY
  }

  if(collide(newHead,snake) || snakeY > 17*box || snakeY < 3*box || snakeX > 17*box || snakeX < box){
      clearInterval(game);
      dead.play();ctx.fillStyle = "white";
      ctx.font = "45px Changa one";
      ctx.fillText("<= score",3*box,1.6*box);
  }
  snake.unshift(newHead);

  ctx.fillStyle = "white";
  ctx.font = "45px Changa one";
  ctx.fillText(score,2*box,1.6*box);
}

let game = setInterval(draw, 100);